    /* validates current submitted form is valid and free from errors
     * @param : pass the event
     * @retun : boolean
     */

    isValidForm(event) {
        return ($(event.target).parents("form").find(".error-border").length == 0) ? true : false;
    }

    isValidScriptRowForm(event) {
        return ($(event.target).parents("form#scriptRowForm").find(".error-border").length == 0) ? true : false;
    }  

    getLsmName(lsmSelectedVersion) {
        this.selectedLsmName ="";
        this.selSearchSMName ="";
        if(lsmSelectedVersion) {
            this.scriptData = Object.values(this.tableData.scriptInfoWithoutSM[lsmSelectedVersion]);   
            this.scriptConfig["limitTo"] = this.scriptData.length;
        }else {
            this.lsmNameDetails = [];
            this.scriptData = this.tableData.scriptInfo;
            this.scriptConfig["limitTo"] = this.scriptData.length;
        }
        this.lsmNameDetails = Object.keys(this.tableData.nwTypeInfo[lsmSelectedVersion]);
    }
    getScriptList(lsmSelectedVersion, selectedLsmName) {          
        this.scriptLists[0].script =[];
        this.scriptDetails = [];       
        setTimeout(()=>{
            if (selectedLsmName) {                         
                this.scriptData = Object.values(this.tableData.nwTypeInfo[lsmSelectedVersion][selectedLsmName]);                                                                                   
                this.scriptConfig["limitTo"] = this.scriptData.length;
            }
            else {
                this.getLsmName(lsmSelectedVersion);
                this.scriptData = this.tableData.scriptInfo;
                this.scriptConfig["limitTo"] = this.scriptData.length;
            }
            
        },0);  
      
    }

    saveScript(event,index,key) {    
       console.log(this.scriptLists);
        if (this.scriptLists[index].script !="" && this.scriptLists[index].script != undefined) {
            this.validaionScriptData.rules.scriptDetails.required = false;    
        } else {
            this.validaionScriptData.rules.scriptDetails.required = true;    
        }  

       validator.performValidation(event, this.validaionScriptData, "save_update");
           
       //Search for duplicate execution sequence 
        if (key.scriptSequence != "") {
            for (let i = 0; i < this.scriptTableData.length; i++) {
                if (this.scriptTableData[i].scriptSequence == key.scriptSequence) {
                    this.validaionScriptData.rules["scriptSequence"].customfunction = true;
                    break;
                } else {
                    this.validaionScriptData.rules["scriptSequence"].customfunction = false;
                }
            }
        }
        else {
            this.validaionScriptData.rules["scriptSequence"].customfunction = false;
        }
        setTimeout(() => {
            if (this.isValidForm(event)) {            
                this.scriptLists[index].cmdRules = this.ruleList.cmdRules;
                this.scriptLists[index].xmlRules = this.ruleList.xmlRules;
                this.scriptLists[index].fileRules = this.ruleList.fileRules;
                this.scriptLists[index].shellRules = this.ruleList.shellRules;

                for (var i = 0; i < this.scriptLists[index].cmdRules.length; i++) {
                    if (this.scriptLists[index].cmdRules[i].incmdEditMode) { 
                        this.scriptLists[index].cmdRules.splice(i,1);   // Delete row if it is in editmode without save
                    } 
                }               
                for (var i = 0; i < this.scriptLists[index].xmlRules.length; i++) {
                    if (this.scriptLists[index].xmlRules[i].inxmlEditMode) {
                        this.scriptLists[index].xmlRules.splice(i,1);
                    } 
                }
                for (var i = 0; i < this.scriptLists[index].fileRules.length; i++) {
                    if (this.scriptLists[index].fileRules[i].infileEditMode) {
                        this.scriptLists[index].fileRules.splice(i,1);
                    } 
                }
                for (var i = 0; i < this.scriptLists[index].shellRules.length; i++) {
                    if (this.scriptLists[index].shellRules[i].inshellEditMode) {
                        this.scriptLists[index].shellRules.splice(i,1);
                    } 
                }
                this.scriptTableData.push(this.scriptLists[index]);
                this.scriptTable = true;
                this.scriptForm = false;
                setTimeout(() =>{
                    let tableWidth = document.getElementById('scriptInfo').scrollWidth;                
                    $(".useCaseScriptTable .scrollBody table#scriptTableData").css("min-width", (tableWidth) + "px");
                    $(".useCaseScriptTable .scrollHead table#scriptInfo").css("width", tableWidth + "px");                
                    
                },0);
            }
        }, 1000);
        

        
    }
