    editRules(event, key, index, ruleName) {
        let errorMsg = "edit is in progress. Please save or cancel the current editing row.";
        if (ruleName == 'fileRule') {
            if (!this.checkRowInEditMode(ruleName)) {
                //Save old data to use when canceled
                this.currFileEditScript = JSON.parse(JSON.stringify(this.ruleList.fileRules[index]));  //Making deep copy
                key.infileEditMode = true;
            }
            else {
                this.displayModel("File Rule " + errorMsg, "failureIcon");
            }
        } else if (ruleName == 'cmdRule') {
            if (!this.checkRowInEditMode(ruleName)) {
                //Save old data to use when canceled
                this.currCmdEditScript = JSON.parse(JSON.stringify(this.ruleList.cmdRules[index]));  //Making deep copy              
                key.incmdEditMode = true;
            }
            else {
                this.displayModel("CLI/Shell " + errorMsg, "failureIcon");
            }
        } else if (ruleName == 'xmlRule') {
            if (!this.checkRowInEditMode(ruleName)) {
                //Save old data to use when canceled
                this.currXmlEditScript = JSON.parse(JSON.stringify(this.ruleList.xmlRules[index]));  //Making deep copy
                key.inxmlEditMode = true;
            }
            else {
                this.displayModel("XML Rule " + errorMsg, "failureIcon");
            }
        }else if (ruleName == 'shellRule') {
            if (!this.checkRowInEditMode(ruleName)) {
                //Save old data to use when canceled
                this.currShellEditScript = JSON.parse(JSON.stringify(this.ruleList.shellRules[index]));  //Making deep copy
                key.inshellEditMode = true;
            }
            else {
                this.displayModel("Shell Rule " + errorMsg, "failureIcon");
            }
        }
    }

    checkRowInEditMode(ruleName) {
        let isInEditMode = false;
        if (ruleName == 'cmdRule') {            
            for (let i = 0; i < this.ruleList.cmdRules.length; i++) {
                if (this.ruleList.cmdRules[i].incmdEditMode == true) {
                    isInEditMode = true;
                    break;
                }
            }
        }
        else if(ruleName == 'xmlRule') {
            for (let i = 0; i < this.ruleList.xmlRules.length; i++) {
                if (this.ruleList.xmlRules[i].inxmlEditMode == true) {
                    isInEditMode = true;
                    break;
                }
            }
        }
        else if(ruleName == 'fileRule') {
            for (let i = 0; i < this.ruleList.fileRules.length; i++) {
                if (this.ruleList.fileRules[i].infileEditMode == true) {
                    isInEditMode = true;
                    break;
                }
            }
        }
        else if(ruleName == 'shellRule') {
            for (let i = 0; i < this.ruleList.shellRules.length; i++) {
                if (this.ruleList.shellRules[i].inshellEditMode == true) {
                    isInEditMode = true;
                    break;
                }
            }
        }
        return isInEditMode;
    }
  
